function interpolateGaps(arr) {
  const result = [];
  let start = null;
  let end = null;

  // Find the start and end of the array with values
  for (let i = 0; i < arr.length; i++) {
    if (arr[i] !== null && arr[i] !== undefined) {
      start = i;
      break;
    }
  }

  for (let i = arr.length - 1; i >= 0; i--) {
    if (arr[i] !== null && arr[i] !== undefined) {
      end = i;
      break;
    }
  }

  // Handle the gaps before the first value
  result.push(...Array(start).fill(null));

  // Interpolate the gaps between values
  for (let i = start; i < end; i++) {
    if (arr[i] !== null && arr[i] !== undefined) {
      result.push(arr[i]);
    } else {
      // Interpolate the gap
      const interpolatedValue = (arr[start - 1] + arr[end]) / 2;
      result.push(interpolatedValue);
    }
  }

  // Handle the gaps after the last value
  result.push(...Array(arr.length - end - 1).fill(null));

  return result;
}
